import React, { Component } from "react";
import Stock from "./stock";

class Fridge extends Component {
  render() {
    return (
      <table>
        <thead>
          <tr>
            <tr>name</tr>
            <tr>purchased at</tr>
            <tr></tr>
          </tr>
        </thead>
        {this.props.stocks.map((stock) => (
          <Stock key={stock.id} stock={stock} />
        ))}
      </table>
    );
  }
}

export default Fridge;
